const PaginationSubpage = ({ totalPage }) => {
  let pages = [];
  for (let i = 1; i <= totalPage; i++) {
    pages.push(i);
  }
  console.log(pages);
  return (
    <>
      <div className="pagination-subpage-box">
        <button>prew</button>
        {pages.map((page, ix) => {
          <button>{pages}</button>;
        })}
        <button>next</button>
      </div>
    </>
  );
};

export default PaginationSubpage;
